import { faGithub } from '@fortawesome/free-solid-svg-icons'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'


function Social() {
    return (
        <div>
            <div className="social-icons">
                <a target="_blank" href="https://github.com/liamvolschenk"><img className="icon" src="/github.png" alt="git" /></a>
                <FontAwesomeIcon icon={faGithub} />
                <a target="_blank" href="https://www.linkedin.com/in/liam-volschenk-a72538116/"><img className="icon linked" src="/linkedin.png" alt="linkedin" /></a>
            </div>
        </div>
    );
}

export default Social;
